ProtobufHelper WxProtobuf::protobufHelper;


uint32_t WxProtobuf::newMsg(std::vector<uint8_t>& out_buff,
                            std::string& to_wxid,
                            std::string& msg_content,
                            std::uint32_t& client_mgs_id,
                            const std::vector<std::string>& vec_at_list) {
//    [1](i):1
//    [2](b):
//    [2.1](b):
//        [2.1.1](b):49729349084@chatroom
//    [2.2](b):@zhuzhu-xia?@zhuzhu?123123
//    [2.3](i):1
//    [2.4](i):3290033723  utc
//    [2.5](i):4108603026  client msg id
//    [2.6](b):<msgsource><atuserlist><![CDATA[,wxid_8d124lgymw8o22,wxid_4zr616ir6fi122]]></atuserlist></msgsource>

    out_buff.resize(0x100);
    JSON input_json= JSON::parse(R"(
{
    "1":1,
    "2":{
        "1" : {"1":"wxid_4zr616ir6fi122"},
        "2" : "msg_from_auto",
        "3" : 1,
        "4" : 1686669176,
        "5" : 1686669176
        }
}
)");
//    uint32_t time_stamp=getULongTimeStmp();
    uint32_t time_stamp=Utils::getULongTimeStmp();
    input_json["2"]["1"]["1"]=to_wxid;
    input_json["2"]["1"]["1"]=to_wxid;
    input_json["2"]["2"]=msg_content;
    input_json["2"]["4"]=time_stamp;
    client_mgs_id=time_stamp+0x200;
    input_json["2"]["5"]=client_mgs_id;


    if(vec_at_list.size()>0){
        std::stringstream at_list;
        at_list<<"<msgsource><atuserlist><![CDATA[";
        for(auto& item : vec_at_list){
            at_list<<","<<item;
        }
        at_list<<"]]></atuserlist></msgsource>";
        input_json["2"]["6"]=at_list.str();
    };

    return protobufHelper.json2pb(input_json,out_buff.data(),0x100);

}

uint32_t
WxProtobuf::revokeMsg(
        vector<uint8_t> &out_buff,
        std::string from_wxid,
        std::string to_wxid,
        std::string devicesID,
        std::uint32_t Uin,
        std::uint64_t SvrNewMsgId
        ) {
    out_buff.resize(0x100);
    JSON input_json= JSON::parse(R"(
{
    "1": {
        "1": "",
        "2": 1869570990,
        "3": "W03d125314b0e5da",
        "4": 1661534743,
        "5": "Windows 10 x64",
        "6": 0
    },
    "2": "",
    "3": 3195155474,
    "4": 1687443303,
    "5": 0,
    "6": "wxid_lkrrzokc7epn22",
    "7": "wxid_4zr616ir6fi122",
    "8": 10,
    "9": "4570478765400648889"
}
)");

    uint32_t time_stamp=Utils::getULongTimeStmp();
    input_json["1"]["2"]=Uin;   //UIN
    input_json["1"]["3"]=devicesID;   //DeviceID
    input_json["1"]["4"]=E_ClientVersion::V_3_9_2_23;   //ClientVersion
//    input_json["1"]["5"]=DeviceType;   //DeviceType

    input_json["3"]=time_stamp;   //NewClientMsgId
    input_json["4"]=time_stamp;   //CreateTime
    input_json["6"]=from_wxid;   //FromUserName
    input_json["7"]=to_wxid;   //ToUserName
    input_json["8"]=26;   //IndexOfRequest  ipad协议写的这个
    input_json["9"]=SvrNewMsgId;   //SvrNewMsgId

    return protobufHelper.json2pb(input_json,out_buff.data(),0x100);

}

uint32_t
WxProtobuf::addChatroomMember(
        vector<uint8_t> &out_buff,
        std::string& devicesID,
        std::uint32_t Uin,
        std::string& rooid,
        std::vector<std::string>& userIds
        ) {

    out_buff.resize(0x100+userIds.size()*25);
    JSON input_json= JSON::parse(R"(
{
    "1": {
        "1": "",
        "2": 1869570990,
        "3": "W03d125314b0e5da",
        "4": 1661534743,
        "5": "Windows 10 x64",
        "6": 0
    },
    "2": 2,
    "3": [

    ],
    "4": {
        "1": "49729349084@chatroom"
    }
}
)");
    JSON member_field= JSON::parse(R"(
    {
        "1": {
            "1": "wxid_"
        }
    }
)");
    for(auto userID : userIds){
        member_field["1"]["1"]=userID;
        input_json["3"].push_back(member_field);
    }

    uint32_t time_stamp=Utils::getULongTimeStmp();
    input_json["1"]["2"]=Uin;   //UIN
    input_json["1"]["3"]=devicesID;   //DeviceID
    input_json["1"]["4"]=E_ClientVersion::V_3_9_2_23;   //ClientVersion

    input_json["2"]=userIds.size();
//    input_json["3"]=userIds;
    input_json["4"]["1"]=rooid;
    auto ret_size=protobufHelper.json2pb(input_json,out_buff.data(),out_buff.size());
    out_buff.resize(ret_size);
    return ret_size;

}

